INSERT INTO `mis_defined_charts` VALUES (144,1,'Which Charts Have Access To?',16,10,1,'2019-10-03 08:16:11',144,NULL,'This table can be used in conjunction with the page filter to see what and why users have access to.',0,'!ASzBX8f3_20BBfRkRw/AWSgU6mFg+AJHT6WSGI2u7',0,0,-1,0,0,0,0,'Which Charts Have Access To?',1,0,0,1,'53b23c3f2ce64222b9c744ad5af6cf0f',21,0,NULL),(145,5,'Charts Allocated to Home',17,28,1,'2019-10-03 08:16:11',145,NULL,'Any charts in the home area are available to all users.  It is good practise to asign them to another controlled category.',0,'!s9CQlhKx_hDF10gXabx88cS4cutqJfxsHaoBW72RB',0,0,-1,0,0,0,0,'Charts Allocated to Home',1,0,0,1,'a3e2ea626eff4ce88180eff77e650d3d',21,0,NULL),(146,1,'No Default Layout',17,10,1,'2019-10-03 08:16:11',146,NULL,'This table should display no data - It is good practise to create a default layout for each display category.  The when a user is allocated this catgeory or you create chart viewres then they get an actually controlled layout rather than the default 2 x 4 layout filled with the first 4 charts in the category.',0,'!HLhaLiVQ_2OSH0stv79xhexAcvXfjbI9watpEC97Z',0,0,-1,0,0,0,0,'No Default Layout',1,0,0,1,'53fe7787974843638213628388e6cc0d',21,0,NULL),(147,1,'Current Logons',18,10,1,'2019-10-03 08:16:11',147,NULL,'This chart lists all current active sessions by user code.  The last activity date and time shows when the last request was made by the user and therfore an indication of whether they are currently active.',0,'!XgCPdnDY_yrCB/b6nTbR/0cV067nAnxh8CE3cWUyk',0,0,-1,0,0,0,0,'Current Logons',1,0,0,1,'232a8ba30c3b41489ee8e63d32077031',21,0,NULL),(148,1,'Dashboard User Activity - Last 60 Days',18,6,1,'2019-10-03 08:16:11',148,NULL,'All user acitivity in the last 60 days.\n\nThe data from this chart is supplied by the audit records held against a user account.',0,'!b89LilKn_EAeFWZh7dR8ifVe+/3RcRGqqaihAJNoW',0,0,-1,0,0,0,0,'Dashboard User Activity - Last 60 Days',1,0,0,1,'339cf592c4a14c5ab8b039accc66fc02',21,0,NULL